import React, { useState } from 'react'
import { useEffect } from 'react'
import './Row.css'
import axios from 'axios'
function Row() {

  const [movie,setmovie]=useState([])

useEffect(()=>{
  async function fetchdata(){
    try{
      const res = await axios.get('https://api.themoviedb.org/3/trending/all/week?api_key=32ce6adcd8f4737faa4cf686afa6b000&language=en-US')
      console.log(res.data.results);
      const imagedata= res.data.results
      for (let images of imagedata){
        setmovie(res.data.results[images])
      }
     
    } catch(error){
      console.log(error)
    }  
  }
  fetchdata();
},[])
 
  return (
    <div className='row'>
      <h1>Trending Now</h1>
      
      <div className="row_posters">
        <img src={`https://image.tmdb.org/t/p/original/${movie.poster_path}`} alt="ri" />
      </div>
    </div>
  )
}

export default Row


